import React, {useEffect} from 'react'
import ItemForm from './ItemForm';

export default function AddItem() {

    const [item, setItem] = useState();

    useEffect(() => {
        setItem({
            name: 'mark'
        })
    }, []);

    return <ItemForm item={item}/>
}
